import React from "react";
import classes from "./PostcodeForm.module.css"

export const PostcodeForm = ({onSubmitPostcode} : {onSubmitPostcode: (val:string)=>void}) => {

      const [postCode,setPostCode] = React.useState("");

      const handleChange = (e:any) => {
        setPostCode(e.target.value);
      }

      const handleSubmit = (e:any) => {
        e.preventDefault();
        onSubmitPostcode(postCode);
      }

        return (
          <div className={classes.abs} >
          <form onSubmit={handleSubmit}>
            <div className="center">
            <label >
              Name:
              <input className="center" type="text" value={postCode} onChange={handleChange} />
            </label>
            <input type="submit" value="Submit" />
            </div>
          </form>
          </div>
        );

}
